from typing import List, Mapping

class Solution:
    def maxTwoEvents(self, events: List[List[int]]) -> int:
        maxSum = 0
        s = Schedule()
        for i in events:
            e = Event(i[0], i[1], i[2])
            maxSum = max(maxSum, s.addEvent(e))
        return maxSum
