class Event:
    def __init__(self, s: int, e: int, v: int):
        self.start = s
        self.end = e
        self.value = v

class Slot:
    def __init__(self, s: int):
        self.start = s
        self.current_max_value = 0
        self.events = []

    def add_event(self, e: Event):
        self.current_max_value = max(self.current_max_value, e.value)
        self.events.append(e)


class Schedule:
    def __init__(self):
        self.slots: Mapping[int,Slot] = dict()

    def addEvent(self, e: Event) -> Event:
        s: Slot = None
        if e.start in self.slots:
            s = self.slots[e.start]
        else:
            s = Slot(e.start)
            self.slots[e.start] = s
        
        maxValue = self.getNextBiggestSlot(e)
        s.add_event(e)
        return maxValue

    def getNextBiggestSlot(self, e: Event) -> int:
        nextEventTimes = [k for k in self.slots.keys() if k > e.end or k < e.start]
        maxVal = e.value
        for ne in nextEventTimes:
            maxVal = max(maxVal, self.slots[ne].current_max_value + e.value)
        return maxVal



